import React, { useState } from 'react';
import './App.css';
import menuIcon from './assets/menu.png';
import closeIcon from './assets/close.png';
import backgroundImage from './assets/background.jpg';

function App() {
  const [isNavOpen, setIsNavOpen] = useState(false);

  const handleClick = () => {
    setIsNavOpen(!isNavOpen);
  };

  return (
    <div className="container">
      <nav className="navbar">
        <div className="logo">
          <h2>Hackathon 2025</h2>
        </div>

        <div className={`nav-links ${isNavOpen ? 'active' : ''}`}>
          <a href="#sponsor">Sponsor Us</a>
          <a href="#mentor">Mentor</a>
          <a href="#faq">FAQ</a>
          <button className="register-btn">REGISTER NOW</button>
        </div>

        <button className="nav__button" onClick={handleClick}>
          <img 
            src={isNavOpen ? closeIcon : menuIcon} 
            alt={isNavOpen ? "Close Menu" : "Open Menu"}
            width="25"
            height="25"
          />
        </button>
      </nav>

      <main className="main-content">
        <div className="hero-section">
          <div className="hero-image">
          </div>

          <div className="hero-content">
            <h1>Hackathon<br />UX Hackathon</h1>
            <p className="date">February 13, 2021 — February 14, 2021</p>
            <p className="description">
              Test your rapid prototyping and design thinking skills! Push the limits 
              of your mind to make something amazing.
            </p>
            <button className="register-btn">REGISTER</button>
          </div>
        </div>

        <div className="how-it-works">
          <h2>How Does it Work?</h2>
          <p>
            You're used to the normal design process — now try it at 10x the speed. 
            The added benefit is NO CODE JUST DESIGN!
          </p>
        </div>
      </main>
    </div>
  );
}

export default App;
